import Form from '../Form/Form';

const Income = () => {
  const {addIncome, incomes, getIncomes} = useGlobalContext();
  return (
    <IncomeStyled>
      <InnerLayout>
        <h1>Incomes</h1>
        <div className='income-content'>
          <div className='form-container'>
            <Form/>
          </div>
          <div className='incomes'></div>
        </div>
      </InnerLayout>
    </IncomeStyled>
  )
}

